import React from 'react';
import {Link} from 'react-router-dom';
function Home() {
    return (
      
        <div>
             <NavLink to='/about' exact ><h1 className="about"> About</h1></NavLink>
            <div className="interface">
               
             <h1>SA interface</h1>
             <div className="form">
                 <input type="text" id="input-form"  name="comments" autoComplete="Off" required/>
                 <label htmlFor="comments" className="label-comments">
                     <span className="content-comments">Enter some comments</span>
                     </label>
             </div>
             </div>
        </div>
     
    )
}

export default Home
